import React from 'react';
import './Calc.css'

let Calc = (props) => {

    return (
    <div className='Calc'>
            <form className='Form'> 
            У Вас есть  <input type='number' defaultValue='0.000' min='0' onChange={props.onChange} value={props.cost1}></input> {props.val1}
            <br></br>
            <br></br>
            <br></br>
            Вы получите  <input type='number' value={props.cost2} readOnly></input> {props.val2}
            </form>  

    </div>)}

export default Calc
